import uniqid from "uniqid";
import React from "react";

const Overview = (props) => {
  const { tasks, deleteFunction } = props;
  return (
    <div>
      {tasks.map(
        (item) => (
          (
            <p>
              {item.id}. {item.task}
            </p>
          ),
          (<button onClick={deleteFunction(item.id)}>Delet</button>)
        )
      )}
    </div>
  );
};

export default Overview;
